  \"2013-03-15T11:47:12.683478\",\n\t\"name\": \"spatial-vegetation-data-for-valley-forge-national-historical-park-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The vegetation and landcover of Valley
  Forge National Historical Park (VAFO) were mapped to the association level of the
  National Vegetation Classification System developed by The Nature Conservancy and
  network of Natural Heritage Programs. The mapping process was based on the USGS-NPS
  Vegetation Mapping Program with some modifications due to the size of the mapped
  polygons. A total of 308 plots were used to assess the thematic accuracy of the
  database. The estimated overall thematic accuracy of the database is 81.20 percent.
  At a 90 percent confidence interval, the estimated minimum overall thematic accuracy
  is 77.40 percent and the estimated maximum is 85.00 percent. Based on hypothesis
  testing, the final association level classification meets the minimum overall thematic
  accuracy of 80 percent specified in NPS vegetation mapping protocols.\",\n\t\"license_title\":
